import React from "react";
import style from "./index.module.scss";
class TripPlanner extends React.Component {
  render() {
    return (
      <div>
        <div className={style.container}>
          <div className={style.routeContainer}></div>
        </div>
      </div>
    );
  }
}

export default TripPlanner;
